import React from "react";

const DIsplayItem = ({ liDigits }) => {
  return (
    <div className="digitflex">
      {liDigits.map((digit) => {
        return <p className="digit">{digit}</p>;
      })}
    </div>
  );
};
export default DIsplayItem;
